,40,'2020-01-02 17:06:48.471096','2024-04-19 01:00:07.275623',0,1,1,1,'',2,5,0,NULL,NULL),(297,2,'question_files/question_297.mp3',NULL,1,7,33,'2020-01-02 17:07:23.639309','2024-04-19 01:00:07.137478',0,1,1,1,'',2,6,0,NULL,NULL),(298,2,'question_files/question_298.mp3',NULL,1,7,50,'2020-01-02 17:07:59.474161','2024-04-19 01:00:07.258500',0,1,1,1,'',2,4,0,NULL,NULL),(299,2,'question_files/question_299.mp3',NULL,1,7,22,'2020-01-02 17:09:02.910464','2024-04-19 01:00:07.342756',0,1,1,1,'',2,9,0,NULL,NULL),(300,2,'question_files/question_300.mp3',NULL,1,6,33,'2020-01-02 17:09:37.001828','2024-04-19 01:00:07.096918',0,1,1,1,'',2,6,0,NULL,NULL),(301,2,'question_files/question_301.mp3',NULL,1,0,0,'2020-01-02 17:10:09.957856','2024-04-27 23:35:28.621611',0,1,1,42,'',0,0,0,NULL,NULL),(302,2,'question_files/question_302.mp3',NULL,1,7,20,'2020-01-02 17:10:43.221566','2024-04-19 01:00:07.336435',0,1,1,1,'',1,5,0,NULL,NULL),(303,2,'question_files/question_303.mp3',NULL,1,7,37,'2020-01-02 17:11:27.349246','2024-04-19 01:00:07.252311',0,1,1,1,'',3,8,0,NULL,NULL),(304,2,'question_files/question_304.mp3',NULL,1,7,66,'2020-01-02 17:12:00.584808','2024-04-19 01:00:07.113490',0,1,1,1,'',4,6,0,NULL,NULL),(305,2,'question_files/question_305.mp3',NULL,1,6,16,'2020-01-02 17:12:35.417227','2024-04-19 01:00:07.302272',0,1,1,1,'',1,6,0,NULL,NULL),(339,5,'','Got a bug bite problem? Many people who are troubled by skin rashes caused by bug bites use\r\n“foggers,” or “bug bombs,” to get rid of the annoying crawlers in their homes. Many people think these bug killers or pesticides will penetrate every place where the insects hide. Actually, quite the opposite is true. Once the pests detect the chemical fog in the room, they’ll hide themselves in walls or other hideaways, where you’ll never be able to treat them effectively.\r\nOhio State University researchers tested three commercially sold foggers in a study on the effect of foggers on bedbugs. After testing these brands on five different groups of live bedbugs for two hours, the scientists saw that the foggers had little—if any—effect on the insects. The researchers said bedbugs hide in cracks and crevices such as under sheets and mattresses, or deep in carpets where foggers won’t reach. Moreover, bugs that do come in contact with the mist may be resistant to the pesticide.\r\nFoggers, or bug bombs, should really be a measure of last resort. First of all, the gases used in bug bombs are highly flammable and thus pose a serious risk of fire or explosion if the product is not used properly. Second, once a bug bomb is used, every surface in your home will be covered with the toxic pesticide. When you use a bug bomb, a chemical mixture rains down on your counters, furniture, floors, and walls, leaving behind oily and toxic substances. Your health might thus be endangered. Therefore, it is suggested that people leave the problem to the professionals.\r\n\r\nWhat is this passage mainly about?',1,9,66,'2020-02-20 10:27:20.702517','2024-04-08 00:45:33.313341',0,1,1,1,'',2,3,0,NULL,NULL),(340,5,'','Earworms often take the form of song fragments rather than entire songs, and the song is usually a familiar one. Researchers are not sure why some songs are more likely to get stuck in our heads than others, but everyone has their own tunes. Often those songs have a simple, upbeat melody and catchy, repetitive lyrics, such as popular commercial jingles and slightly annoying radio hits. Recent or repeated exposure to a song or even a small part of a song can also trigger earworms, as can word associations, such as a phrase similar to the lyrics of a song.\r\nWhile earworms might be annoying, most people who experience them nevertheless report that they are pleasant or at least neutral. Only a third of people are disturbed by the song in their heads. How people cope with their earworms seems to depend on how they feel about them. Those who have positive feelings about their stuck songs prefer to just “let them be,” while those with negative feelings turn to more behavioral responses, which include coping strategies such as singing, talking, or even praying.\r\n\r\nAccording to the passage, which of the following is true about an earworm?',1,9,0,'2020-02-20 11:03:59.831897','2024-04-08 00:45:33.277999',0,1,1,1,'',0,3,0,NULL,NULL),(341,5,'','Angelfish, often found in the warm seas and coral reefs, are among the most brightly colored fish of\r\nthe ocean. Brilliant colors and stripes form amazing patterns on their body. These patterns actually help the fish to hide from danger among roots and plants. At night, when these fish become inactive, their colors may become pale. Often, the young ones are differently colored than the adults. Some scientists believe that the color difference between the young and the old indicates their different social positions.\r\nAnother interesting fact about angelfish is that they have an occupation in the fish world. Most of them act as cleaners for other fish and pick dead tissue from their bodies. This is not their food, though. Their diet consists mainly of sponge and algae.\r\n\r\nWhat is the job of an angelfish in the sea?',1,9,100,'2020-02-20 11:27:34.292146','2024-04-08 00:45:33.352871',0,1,1,1,'',3,3,0,NULL,NULL),(342,5,NULL,'Redwood trees are the tallest plants on the earth, reaching heights of up to 100 meters. They are also known for their longevity, typically 500 to 1000 years, but sometimes more than 2000 years. A hundred million years ago, in the age of dinosaurs, redwoods were common in the forests of a much more moist and tropical North America. As the climate became drier and colder, they retreated to a narrow strip along the Pacific coast of Northern California.\r\nThe trunk of redwood trees is very stout and usually forms a single straight column. It is covered with a beautiful soft, spongy bark. This bark can be pretty thick, well over two feet in the more mature trees. It gives the older trees a certain kind of protection from insects, but the main benefit is that it keeps the center of the tree intact from moderate forest fires because of its thickness. This fire resistant quality explains why the giant redwood grows to live that long. While most other types of trees are destroyed by forest fires, the giant redwood actually prospers because of them. Moderate fires will clear the ground of competing plant life, and the rising heat dries and opens the ripe cones of the redwood, releasing many thousands of seeds onto the ground below.\r\nNew trees are often produced from sprouts, little baby trees, which form at the base of the trunk. These sprouts grow slowly, nourished by the root system of the “mother” tree. When the main tree dies, the sprouts are then free to grow as full trees, forming a “fairy ring” of trees around the initial tree. These trees, in turn, may give rise to more sprouts, and the cycle continues.\r\n\r\nWhy were redwood trees more prominent in the forests of North America millions of years ago?',1,5,0,'2020-02-29 15:34:53.444568','2020-02-29 17:45:13.521720',0,1,1,5,'',0,0,0,NULL,NULL),(343,5,'','It was something she had dreamed of since she was five. Finally, after years of training and intensive workouts, Deborah Duffey was going to compete in her first high school basketball game. The goals of becoming an outstanding player and playing college ball were never far from Deborah’s mind.\r\nThe game was against Mills High School. With 1:42 minutes left in the game, Deborah’s team led by one point. A player of Mills had possession of the ball, and Deborah ran to guard against her. As Deborah shuffled sideways to block the player, her knee went out and she collapsed on the court in burning pain. Just like that, Deborah’s season was over.\r\nAfter suffering the bad injury, Deborah found that, for the first time in her life, she was in a situation beyond her control. Game after game, she could do nothing but sit on the sidelines watching others play the game that she loved so much.\r\nInjuries limited Deborah’s time on the court as she hurt her knees three more times in the next five years. She had to spend countless hours in a physical therapy clinic to receive treatment. Her frequent visits there gave her a passion and respect for the profession. And Deborah began to see a new light in her life.\r\nCurrently a senior in college, Deborah focuses on pursuing a degree in physical therapy. After she graduates, Deborah plans to use her knowledge to educate people how to best take care of their bodies\r\nand cope with the feelings of hopelessness that she remembers so well.\r\n\r\nWhat is the best title for this passage?',1,8,0,'2020-02-29 15:39:29.093587','2024-04-08 00:45:33.327437',0,1,1,5,'',0,3,0,NULL,NULL),(344,5,'','It is easy for us to tell our friends from our enemies. But can other animals do the same? Elephants\r\ncan! They can use their sense of vision and smell to tell the difference between people who pose a threat and those who do not.\r\nIn Kenya, researchers found that elephants react differently to clothing worn by men of the Maasai and Kamba ethnic groups. Young Maasai men spear animals and thus pose a threat to elephants; Kamba men are mainly farmers and are not a danger to elephants.\r\nIn an experiment conducted by animal scientists, elephants were first presented with clean clothing or clothing that had been worn for five days by either a Maasai or a Kamba man. When the elephants detected the smell of clothing worn by a Maasai man, they moved away from the smell faster and took longer to relax than when they detected the smells of either clothing worn by Kamba men or clothing that had not been worn at all.\r\nGarment color also plays a role, though in a different way. In the same study, when the elephants saw red clothing not worn before, they reacted angrily, as red is typically worn by Maasai men. Rather than running away as they did with the smell, the elephants acted aggressively toward the red clothing.\r\nThe researchers believe that the elephants’ emotional reactions are due to their different interpretations of the smells and the sights. Smelling a potential danger means that a threat is nearby and the best thing to do is run away and hide. Seeing a potential threat without its smell means that risk is low. Therefore, instead of showing fear and running away, the elephants express their anger and become aggressive.\r\n\r\nAccording to the passage, which of the following statements is true about Kamba and Maasai people?',1,7,66,'2020-02-29 15:48:45.946223','2024-04-08 00:45:33.335463',0,1,1,5,'',2,3,0,NULL,NULL),(345,5,'','There is a long-held belief that when meeting someone, the more eye contact we have with the\r\nperson, the better. The result is an unfortunate tendency for people making initial contact—in a job interview, for example—to stare fixedly at the other individual. However, this behavior is likely to make the interviewer feel very uncomfortable. Most of us are comfortable with eye contact lasting a few seconds. But eye contact which persists longer than that can make us nervous.\r\nAnother widely accepted belief is that powerful people in a society—often men—show their dominance over others by touching them in a variety of ways. In fact, research shows that in almost all cases, lower-status people initiate touch. Women also initiate touch more often than men do.\r\nThe belief that rapid speech and lying go together is also widespread and enduring. We react strongly—and suspiciously—to fast talk. However, the opposite is a greater cause for suspicion. Speech that is slow, because it is laced with pauses or errors, is a more reliable indicator of lying than the opposite.\r\n\r\nWhich of the following is NOT discussed in the passage?',1,8,100,'2020-02-29 15:55:36.145688','2024-04-08 00:45:33.272532',0,1,1,5,'',3,3,0,NULL,NULL),(346,5,'','On the island of New Zealand, there is a grasshopper-like species of insect that is found nowhere else on earth. New Zealanders have given it the nickname weta, which is a native Maori word meaning “god of bad looks.” It’s easy to see why anyone would call this insect a bad-looking bug. Most people feel disgusted at the sight of these bulky, slow-moving creatures.\r\nWetas are nocturnal creatures; they come out of their caves and holes only after dark. A giant weta can grow to over three inches long and weigh as much as 1.5 ounces. Giant wetas can hop up to two feet at a time. Some of them live in trees, and others live in caves. They are very long-lived for insects, and some adult wetas can live as long as two years. Just like their cousins grasshoppers and crickets, wetas are able to “sing” by rubbing their leg parts together, or against their lower bodies.\r\nMost people probably don’t feel sympathy for these endangered creatures, but they do need protecting. The slow and clumsy wetas have been around on the island since the times of the dinosaurs, and have evolved and survived in an environment where they had no enemies until rats came to the island with European immigrants. Since rats love to hunt and eat wetas, the rat population on the island has grown into a real problem for many of the native species that are unaccustomed to its presence, and poses a serious threat to the native weta population.\r\n\r\nWhich of the following descriptions of wetas is accurate?',1,7,0,'2020-02-29 16:42:12.673107','2024-04-08 00:45:33.297417',0,1,1,5,'',0,3,0,NULL,NULL),(347,5,'','The high school prom is the first formal social event for most American teenagers. It has also been a\r\nrite of passage for young Americans for nearly a century.\r\nThe word “prom” was first used in the 1890s, referring to formal dances in which the guests of a\r\nparty would display their fashions and dancing skills during the evening’s grand march. In the United States, parents and educators have come to regard the prom as an important lesson in social skills. Therefore, proms have been held every year in high schools for students to learn proper social behavior.\r\nThe first high school proms were held in the 1920s in America. By the 1930s, proms were common across the country. For many older Americans, the prom was a modest, home-grown affair in the school gymnasium. Prom-goers were well dressed but not fancily dressed up for the occasion: boys wore jackets and ties and girls their Sunday dresses. Couples danced to music provided by a local amateur band or a record player. After the 1960s, and especially since the 1980s, the high school prom in many areas has become a serious exercise in excessive consumption, with boys renting expensive tuxedos and girls wearing designer gowns. Stretch limousines were hired to drive the prom-goers to expensive restaurants or discos for an all-night extravaganza.\r\nWhether simple or lavish, proms have always been more or less traumatic events for adolescents who worry about self-image and fitting in with their peers. Prom night can be a dreadful experience for socially awkward teens or for those who do not secure dates. Since the 1990s, alternative proms have been organized in some areas to meet the needs of particular students. For example, proms organized by and for homeless youth were reported. There were also “couple-free” proms to which all students are welcome.\r\n\r\nIn what way are high school proms significant to American teenagers?',1,7,33,'2020-02-29 16:48:27.820614','2024-04-08 00:45:33.365962',0,1,1,5,'',1,3,0,NULL,NULL),(348,5,'','Apple Inc. is an American multinational technology company headquartered in Cupertino, California, that designs, develops, and sells consumer electronics, computer software, and online services. It is considered one of the Big Four technology companies, alongside Amazon, Google, and Facebook.\r\n\r\nThe company\'s hardware products include the iPhone smartphone, the iPad tablet computer, the Mac personal computer, the iPod portable media player, the Apple Watch smartwatch, the Apple TV digital media player, the AirPods wireless earbuds and the HomePod smart speaker. Apple\'s software includes the macOS, iOS, iPadOS, watchOS, and tvOS operating systems, the iTunes media player, the Safari web browser, the Shazam acoustic fingerprint utility, and the iLife and iWork creativity and productivity suites, as well as professional applications like Final Cut Pro, Logic Pro, and Xcode. Its online services include the iTunes Store, the iOS App Store, Mac App Store, Apple Music, Apple TV+, iMessage, and iCloud. Other services include Apple Store, Genius Bar, AppleCare, Apple Pay, Apple Pay Cash, and Apple Card.\r\n\r\nwhich of the following product may not offer by Apple?',1,7,0,'2020-02-29 17:43:24.715578','2024-04-08 00:45:33.305217',0,1,1,5,'',0,3,0,NULL,NULL),(353,1,'question_files/question_353.mp3',NULL,1,0,0,'2020-03-30 10:12:42.576193','2024-04-27 23:35:30.427379',0,1,6,42,'',0,0,0,NULL,NULL),(354,1,'question_files/question_354.mp3',NULL,1,0,0,'2020-03-30 10:24:46.397485','2024-04-27 23:35:32.257800',0,1,6,42,'',0,0,0,NULL,NULL),(355,1,'question_files/question_355.mp3',NULL,1,0,0,'2020-03-30 10:25:36.129900','2024-04-27 23:35:36.182119',0,1,6,42,'',0,0,0,NULL,NULL),(356,1,'question_files/question_356.mp3',NULL,1,0,0,'2020-03-30 10:26:27.701408','2024-04-27 23:35:37.823077',0,1,6,42,'',0,0,0,NULL,NULL),(357,1,'question_files/question_357.mp3',NULL,1,0,0,'2020-03-30 10:27:24.463794','2024-04-27 23:35:39.632522',0,1,6,42,'',0,0,0,NULL,NULL),(358,1,'question_files/question_358.mp3',NULL,1,0,0,'2020-03-30 10:28:23.621289','2024-04-27 23:35:41.241824',0,1,6,42,'',0,0,0,NULL,NULL),(359,1,'question_files/question_359.mp3',NULL,1,0,0,'2020-03-30 10:29:38.673084','2024-04-27 23:35:42.928568',0,1,6,42,'',0,0,0,NULL,NULL),(360,1,'question_files/question_360.mp3',NULL,1,0,0,'2020-03-30 10:30:29.360507','2024-04-27 23:35:46.136815',0,1,6,42,'',0,0,0,NULL,NULL),(361,1,'question_files/question_361.mp3',NULL,1,0,0,'2020-03-30 10:31:31.194595','2024-04-27 23:35:47.809254',0,1,6,42,'',0,0,0,NU